import Link from "next/link";

const Home = (props) => (
  <ul>
    <li>
      <Link href="/b" as="/a">
        <a>a</a>
      </Link>
      {props.porcodio}
    </li>
    <li>
      <Link href="/a" as="/b">
        <a>b</a>
      </Link>
    </li>
  </ul>
);

Home.getInitialProps = ({ porcodio }) => {
  console.log(porcodio);
  return {
    porcodio: porcodio,
  };
};

export default Home;
